import './App.css';
import Habit from './components/habits.jsx';
import React, { useState } from 'react';

const App = props => {

  const [ habits, setHabits ] = useState({
    id: 1, habit: 'Running', count: 0,
  })

  return (
    <h1 onClick={setHabits(habits.habit = "Eating")}>{habits}</h1>
  )

};

export default App;
